import axios from 'axios';
import React from 'react';

class Api extends React.Component {


    getNumberOfUsers() {
        axios.get('https://localhost:50001/api/users')
        .then((res) => {
            const data = res.data;
           
            console.log('Got the data')
        })
        .catch(() => {
            console.log('Did not get the data')
        })
    }
}
